import React from "react";
// reactstrap components
import {
    Button,
    Card,
    CardBody,
    CardFooter,
    CardTitle,
    Form,
    Input,
    InputGroupAddon,
    InputGroupText,
    InputGroup,
    Container,
    Row,
    Col,
    Fade
} from "reactstrap";

import ExamplesNavbar from "../../components/Navbars/ExamplesNavbar";
// core components

import SubS from "views/TeamPage/components/Subsystems/Subsystem";
import Heading from "./components/Heading/Heading";
import FadeIn from 'views/Animations/FadeIn';
import TeamHeads from "./components/TeamHeads/TeamHeads";
// import { Container } from "reactstrap";
function Mechanical() {
    // document.documentElement.classList.remove("nav-open");
    // React.useEffect(() => {
    //     document.body.classList.add("profile-page");
    //     return function cleanup() {
    //         document.body.classList.remove("profile-page");
    //     };
    // });
    return (
        <div>
            <ExamplesNavbar activePage="/team" />
            <div className="main">
                <FadeIn>
                    <Heading subsystem="Mechanical Subsystem"/>
                </FadeIn>
                <FadeIn>
                    <TeamHeads />
                </FadeIn>
            </div>
        </div>
    );
}

export default Mechanical;
